    //   <div className='line'/>
    // </footer>



<div class="footer">
  <div class="containearr">
  <div class="col">
    <h1>PYME</h1>
    <ul>
      <li>Sobre Nosotros</li>
      <li></li>
    </ul>
  </div>
  <div class="col">
    <h1>Productos</h1>
    <ul>
      <li>Armado de pc</li>
      <li>Sevicio Tecnico</li>
      <li>Mantenciones</li>
